import React from 'react';

const Card = ({ src }) => {
    return (
        <div className="col mb-5">
            <div className="card" style={{ width: "18rem" }}>
                <img src={src} className="card-img-top" alt="_card" />
            </div>
        </div>
    )
}

export default Card;
